import React from 'react'

const BlogPost = () => {
    const data =[
                        {
                            id: 1,
                            title:'Lord of the ring',
                            author:'Jehros Rina',
                            data: 'January 20, 2023',
                            content:' Lorem Epselum content',
                        },
                        
                ]

  return (
    <div>
    
      {data.map(el => (
        <div key={el.id}>
        <p>{el.title}</p>
         <p>By: {el.author}</p>
         <p>{el.date}</p>
        <p>{el.content}</p>
        </div>
      ))}
    
    </div>
  )
}

export default BlogPost
